import OneNews from '../Items/OneNews';

const Page8RelatedNews = (props) => {
    return (
        <section className='container'>
            <h2 className='title-title'>Related Articles</h2>
            <div>
                <section className="row">
                    {props.news.map((news, index) => ( // Thêm index vào hàm map
                        <OneNews key={index} news={news} /> // Sử dụng index làm key
                    ))}
                </section>
            </div>
        </section>
    )
}

export default Page8RelatedNews;
